def get_matrix_indices(string):
    hex_a, hex_b = string_hex_coord_dict[string]
    # string 36 is in center of hex grid: (0,0)
    # To convert to matrix indices, we need to
    # correct for this, e.g. add 4 and 5.
    return hex_a + 4, hex_b + 5


def get_dom_coords(string, dom):
    """Get Coordinates of a DOM specified by the string and dom number.

    Parameters
    ----------
    string : int
        String number (between 1 and 86)
    dom : int
        DOM number (between 1 and 60)

    Returns
    -------
    tuple(float, float, float)
        The x, y, z coordinates of the DOM.
    """
    a, b = get_matrix_indices(string)
    dom_id = dom - 1
    return X_IC79_coords[a, b, dom_id]


